import React,{useState} from 'react';
import fakeData from '../../fakeData';

const Shop = () => {
    const fakeDataTwo = fakeData.slice(0,4);
    console.log(fakeDataTwo);

    const [product, setProduct] = useState(fakeDataTwo);
    return (
        <div>
            <ul>
                {
                    product.map( product => <li>{product.name}</li>)
                }
            </ul>
            
            <div>
            <img src={product.photo} alt=""/>
                
            </div>
        </div>
    );
};

export default Shop;
